import React from "react";
import "./styles.scss";

const menuItems = ["Home", "About", "Work"];

const MenuList = (props) => {
  return (
    <div className="menulist">
      <ul>
        {menuItems.map((item) => (
          <li> {item}</li>
        ))}
      </ul>
    </div>
  );
};

export default MenuList;
